import { Navigate, Route, Routes, Switch } from "react-router-dom";
import Headerbar from "../Headerthingys/Headerbar";
import Postad from "../../pages/Sellingpage/Postad";
import Horizontalbar from "../Horizontalbar/Horizontalbar";
import Mainbody from "../Mainbody/Mainbody";
import SignupPage from "../Loginthingys/SignupPage";
import Login from "../Loginthingys/Login";

const Navigation = () => {
	const user = false;
	return (
		<>
			<Routes>
				<Route path="/" exact>
					<header>
						<Headerbar />
					</header>
					<div>
						<Horizontalbar />
					</div>
					<Mainbody />
				</Route>
				<Route path="/post-ad" exact element={<Postad />} />
				<Route path="/login" exact element={user ? <Navigate to="/" /> : <Login />} />
				<Route path="/signup" exact element={<SignupPage />} />
			</Routes>
		</>
	);
};

export default Navigation;
